SELECT [Time_Lookup_Day to Week Ending Sunday].[Week Ending Sunday], [Hispanic Digital tbl].[Site Name], [Hispanic Digital tbl].[Impressions Delivered], [Hispanic Digital tbl].[Clicks Recorded], [Hispanic Digital tbl].[Media Cost], [Hispanic Digital tbl].[Creative Type], [Hispanic Digital tbl].[Portal Vs Non Portal] FROM [Time_Lookup_Day to Week Ending Sunday] LEFT JOIN [Hispanic Digital tbl] ON [Time_Lookup_Day to Week Ending Sunday].Date = [Hispanic Digital tbl].Date;
